import { Link } from "react-router-dom"
const NavBar = () => {
    return ( 
        <nav className="App">
            <div className="small-box dark-box mx-auto text-center">
                <Link to="/" className="btn btn-secondary btn-lg background:red">Login</Link>
                <Link to="/register" className="btn btn-secondary btn-lg">Register</Link>

                <p className="small-box dark-box mx-auto">Sign With:</p>
            </div>
        </nav>
     );
}
 
export default NavBar;
